import NavBar from "../components/NavBar";
import { Link } from "react-router-dom";
//BOOTSTRAP
import { Container, Row, Col, Button } from "react-bootstrap";
//ICONS
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faHammer } from "@fortawesome/free-solid-svg-icons";

const SpaceCraft = () => {
  return (
    <Container>
      <NavBar />
      <Row className="firstRow">
        <Col>
          <Button variant="outline-light">
            <Link to={"./ShipBuilder"}>
              <FontAwesomeIcon icon={faHammer} /> Build a Ship
            </Link>
          </Button>
        </Col>
      </Row>
      {/* single ship example - going to need to map through array for actual */}
      <Row className="singleShip">
        <Col xs="2" className="shipPicture">
          <img
            src="https://w7.pngwing.com/pngs/225/630/png-transparent-red-spaceship-rocket-icon-rocket-image-file-formats-cartoon-rocket-launch.png"
            alt="Space Ship Picture"
          />
        </Col>
        <Col xs="8" className="shipInfo"></Col>
        <Col xs="1" className="destroyBtn">
          <Button>Destroy</Button>
        </Col>
      </Row>
    </Container>
  );
};
export default SpaceCraft;
